import React from "react";

import footer from "../../data/footer.json";
import "./Footer.css";

const Footer = () => {
  return (
    <footer className="footer">
      {footer.map((item) => (
        <div>
          {item.col_values.map((value) => (
            <a>{value}</a>
          ))}
        </div>
      ))}
    </footer>
  );
};

export default Footer;
